#define SPI_BUFFER_SIZE 2048

void parse_IMX5_message(is_comm_instance_t* imx5_instance, uint8_t* buf)
{
	uint8_t* ptr;
	int i, err;
	protocol_type_t ptype;
	static float tmpf;

	manufacturing_info_t* p0 = (manufacturing_info_t*)imx5_instance->rxPkt.data.ptr;	//IMX5_INS
	ins_1_t* p1 = (ins_1_t*)imx5_instance->rxPkt.data.ptr; 				//IMX5_INS
	imu_t* p2 = (imu_t*)imx5_instance->rxPkt.data.ptr;				//IMX5_IMU
	barometer_t* p3 = (barometer_t*)imx5_instance->rxPkt.data.ptr;			//IMX5_BARO
	gps_pos_t* p4 = (gps_pos_t*)imx5_instance->rxPkt.data.ptr;			//IMX5_VEL
	gps_vel_t* p5 = (gps_vel_t*)imx5_instance->rxPkt.data.ptr;			//IMX5_VEL

	imx5_instance->rxBuf.size = SPI_BUFFER_SIZE;
	imx5_instance->rxBuf.tail = buf + SPI_BUFFER_SIZE;
	imx5_instance->rxBuf.end = buf + SPI_BUFFER_SIZE;
	imx5_instance->rxBuf.scan = buf;
	imx5_instance->rxBuf.head = buf;
	imx5_instance->parser.state = 0;
	imx5_instance->rxBuf.scanPrior = imx5_instance->rxBuf.scan;
	//	imx5_instance->rxBuf.scan = imx5_instance->rxBuf.head;
	imx5_instance->processPkt = NULL;

	// Set parse enable flags
	imx5_instance->config.enabledMask =
		ENABLE_PROTOCOL_ISB
		//		| ENABLE_PROTOCOL_NMEA
		//		| ENABLE_PROTOCOL_UBLOX
		//		| ENABLE_PROTOCOL_RTCM3
				// | ENABLE_PROTOCOL_SONY
				// | ENABLE_PROTOCOL_SPARTN
		;

	imx5_instance->rxPkt.data.ptr = imx5_instance->rxBuf.start;
	imx5_instance->rxErrorState = 1;


	//parse the message
	//System.parser_timer = 0;
	while ((ptype = is_comm_parse(imx5_instance)) != _PTYPE_NONE)
	{
		switch (ptype)
		{
		case _PTYPE_INERTIAL_SENSE_DATA:
			//reset channel counter
			//if (IMX5_channel == SPI_IMX5A)
				//statistics.channel[CHANNEL_IMX5A] = 0;
			//else
				//statistics.channel[CHANNEL_IMX5B] = 0;

			switch (imx5_instance->rxPkt.hdr.id)
			{
			case DID_DEV_INFO:
				*p0 = *(manufacturing_info_t*)imx5_instance->rxPkt.data.ptr;

				break;
			case DID_INS_1:
				handleIns1Message((ins_1_t*)imx5_instance->rxPkt.data.ptr);
				break;
			case DID_IMU:
				handleImuMessage((imu_t*)imx5_instance->rxPkt.data.ptr);
				
				break;
			case DID_BAROMETER:
				handleBarMessage((barometer_t*)imx5_instance->rxPkt.data.ptr);
				break;
			case DID_GPS1_POS:

				handleGpsMessage((gps_pos_t*)imx5_instance->rxPkt.data.ptr);
				break;
			case DID_GPS2_POS:
				handleGpsMessage((gps_pos_t*)imx5_instance->rxPkt.data.ptr);
				
				break;
			case DID_GPS1_VEL:
				
				break;
			case DID_GPS2_VEL:
				
				break;
			}
		}
	}

	//{
	//	QSCI_EnableRx(QSCI0, true);
	//	QSCI_EnableTx(QSCI0, true);
	//}


	/*
	//after finishing IMX5A start IMX5B
	if(IMX5_channel == SPI_IMX5A)
		{
		IMX5_channel = SPI_IMX5B;
		read_IMX5();
		}
	*/
	//Switch_Relay(LED_GREEN,true);

	return;
}


